import{_ as e,c as r,o as a,ag as o}from"./chunks/framework.Bksy39di.js";const h=JSON.parse('{"title":"兼容性与版本","description":"","frontmatter":{},"headers":[],"relativePath":"kmp/compose-compatibility-and-versioning.md","filePath":"kmp/compose-compatibility-and-versioning.md","lastUpdated":1755516278000}'),l={name:"kmp/compose-compatibility-and-versioning.md"};function s(d,t,p,i,m,n){return a(),r("div",null,t[0]||(t[0]=[o('<h1 id="兼容性与版本" tabindex="-1">兼容性与版本 <a class="header-anchor" href="#兼容性与版本" aria-label="Permalink to &quot;兼容性与版本&quot;">​</a></h1><p>Compose Multiplatform 发布版本与 Kotlin 和 Jetpack Compose 发布版本是独立发布的。本页面包含有关 Compose Multiplatform 发布版本、Compose 发布周期以及组件兼容性的信息。</p><h2 id="支持的平台" tabindex="-1">支持的平台 <a class="header-anchor" href="#支持的平台" aria-label="Permalink to &quot;支持的平台&quot;">​</a></h2><p>Compose Multiplatform 1.8.2 支持以下平台：</p><table tabindex="0"><thead><tr><th>平台</th><th>最低版本</th></tr></thead><tbody><tr><td>Android</td><td>Android 5.0 (API level 21)</td></tr><tr><td>iOS</td><td>iOS 13</td></tr><tr><td>macOS</td><td>macOS 12 x64, macOS 13 arm64</td></tr><tr><td>Windows</td><td>Windows 10 (x86-64, arm64)</td></tr><tr><td>Linux</td><td>Ubuntu 20.04 (x86-64, arm64)</td></tr><tr><td>Web</td><td>支持 <a href="https://kotlinlang.org/docs/wasm-troubleshooting.html#browser-versions" target="_blank" rel="noreferrer">WasmGC 的浏览器</a></td></tr></tbody></table><div class="note custom-block"><p class="custom-block-title">NOTE</p><p>所有 Compose Multiplatform 发布版本仅支持 64 位平台。</p></div><h2 id="kotlin-兼容性" tabindex="-1">Kotlin 兼容性 <a class="header-anchor" href="#kotlin-兼容性" aria-label="Permalink to &quot;Kotlin 兼容性&quot;">​</a></h2><p>最新版本的 Compose Multiplatform 始终与最新版本的 Kotlin 兼容。无需手动对齐它们的版本。请记住，使用任何一个产品的抢先体验预览 (EAP) 版本仍然可能不稳定。</p><p>Compose Multiplatform 要求应用的 Compose Compiler Gradle 插件与 Kotlin Multiplatform 插件的版本相同。关于详细信息，请参见 <a href="./compose-compiler#migrating-a-compose-multiplatform-project">undefined</a>。</p><div class="danger custom-block"><p class="custom-block-title">WARNING</p><p>从 Compose Multiplatform 1.8.0 开始，该 UI 框架已完全过渡到 K2 编译器。 因此，要使用最新的 Compose Multiplatform 发布版本，您应该： * 您的项目至少使用 Kotlin 2.1.0； * 仅当基于 Compose Multiplatform 的库是针对 Kotlin 2.1.0 或更高版本编译时，才依赖它们。 作为解决向后兼容性问题的临时解决方案，直到您的所有依赖项都更新， 您可以通过在 <code>gradle.properties</code> 文件中添加 <code>kotlin.native.cacheKind=none</code> 来关闭 Gradle 缓存。 这将增加编译时间。</p></div><h2 id="compose-multiplatform-桌面发布版本的限制" tabindex="-1">Compose Multiplatform 桌面发布版本的限制 <a class="header-anchor" href="#compose-multiplatform-桌面发布版本的限制" aria-label="Permalink to &quot;Compose Multiplatform 桌面发布版本的限制&quot;">​</a></h2><p>Compose Multiplatform 桌面版有以下限制：</p><ul><li>由于 <a href="https://skia.org/" target="_blank" rel="noreferrer">Skia</a> 绑定中使用的内存管理方案，仅支持 JDK 11 或更高版本。</li><li>由于 <code>jpackage</code> 的限制，仅支持 JDK 17 或更高版本用于打包原生分发版。</li><li>在 macOS 上切换键盘布局时，OpenJDK 11.0.12 存在一个已知问题。此问题在 OpenJDK 11.0.15 中无法重现。</li></ul><h2 id="jetpack-compose-与-compose-multiplatform-发布周期" tabindex="-1">Jetpack Compose 与 Compose Multiplatform 发布周期 <a class="header-anchor" href="#jetpack-compose-与-compose-multiplatform-发布周期" aria-label="Permalink to &quot;Jetpack Compose 与 Compose Multiplatform 发布周期&quot;">​</a></h2><p>Compose Multiplatform 与 Google 开发的 Android 框架 <a href="https://developer.android.com/jetpack/compose" target="_blank" rel="noreferrer">Jetpack Compose</a> 共享大量代码。我们将 Compose Multiplatform 的发布周期与 Jetpack Compose 的发布周期对齐，以确保通用代码得到充分测试和稳定。</p><p>当 Jetpack Compose 发布新版本时，我们会：</p><ul><li>使用该发布版本的 commit 作为下一个 <a href="https://github.com/JetBrains/androidx" target="_blank" rel="noreferrer">Compose Multiplatform</a> 版本的基础。</li><li>添加对新平台特性的支持。</li><li>稳定所有平台。</li><li>发布新版本的 Compose Multiplatform。</li></ul><p>Compose Multiplatform 发布版本与 Jetpack Compose 发布版本之间的间隔通常为 1-3 个月。</p><h3 id="compose-multiplatform-的开发版本" tabindex="-1">Compose Multiplatform 的开发版本 <a class="header-anchor" href="#compose-multiplatform-的开发版本" aria-label="Permalink to &quot;Compose Multiplatform 的开发版本&quot;">​</a></h3><p>Compose Multiplatform 编译器插件的开发版本（例如 <code>1.8.2+dev2544</code>）的构建没有固定日程，旨在测试正式发布版本之间的更新。</p><p>这些构建项在 <a href="https://central.sonatype.com/" target="_blank" rel="noreferrer">Maven Central</a> 中不可用。要访问它们，请将此行添加到您的版本库列表：</p><div class="language-kotlin vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">kotlin</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">maven</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">(</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">&quot;https://maven.pkg.jetbrains.space/public/p/compose/dev&quot;</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">)</span></span></code></pre></div><h3 id="使用的-jetpack-compose-构件" tabindex="-1">使用的 Jetpack Compose 构件 <a class="header-anchor" href="#使用的-jetpack-compose-构件" aria-label="Permalink to &quot;使用的 Jetpack Compose 构件&quot;">​</a></h3><p>当您为 Android 构建您的应用程序时，Compose Multiplatform 会使用 Google 发布的构件。例如，如果您应用 Compose Multiplatform 1.5.0 Gradle 插件并将 <code>implementation(compose.material3)</code> 添加到您的 <code>dependencies</code> 中，那么您的项目将在 Android 目标平台中使用 <code>androidx.compose.material3:material3:1.1.1</code> 构件（但在其他目标平台中使用 <code>org.jetbrains.compose.material3:material3:1.5.0</code>）。</p><p>下表列出了每个 Compose Multiplatform 版本使用的 Jetpack Compose 构件版本：</p><table tabindex="0"><thead><tr><th>Compose Multiplatform 版本</th><th>Jetpack Compose 版本</th><th>Jetpack Compose Material3 版本</th></tr></thead><tbody><tr><td><a href="https://github.com/JetBrains/compose-multiplatform/releases/tag/v1.8.2" target="_blank" rel="noreferrer">1.8.2</a></td><td>1.8.2</td><td>1.3.2</td></tr><tr><td><a href="https://github.com/JetBrains/compose-multiplatform/releases/tag/v1.7.3" target="_blank" rel="noreferrer">1.7.3</a></td><td>1.7.6</td><td>1.3.1</td></tr><tr><td><a href="https://github.com/JetBrains/compose-multiplatform/releases/tag/v1.7.1" target="_blank" rel="noreferrer">1.7.1</a></td><td>1.7.5</td><td>1.3.1</td></tr><tr><td><a href="https://github.com/JetBrains/compose-multiplatform/releases/tag/v1.7.0" target="_blank" rel="noreferrer">1.7.0</a></td><td>1.7.1</td><td>1.3.0</td></tr><tr><td><a href="https://github.com/JetBrains/compose-multiplatform/releases/tag/v1.6.11" target="_blank" rel="noreferrer">1.6.11</a></td><td>1.6.7</td><td>1.2.1</td></tr><tr><td><a href="https://github.com/JetBrains/compose-multiplatform/releases/tag/v1.6.10" target="_blank" rel="noreferrer">1.6.10</a></td><td>1.6.7</td><td>1.2.1</td></tr><tr><td><a href="https://github.com/JetBrains/compose-multiplatform/releases/tag/v1.6.2" target="_blank" rel="noreferrer">1.6.2</a></td><td>1.6.4</td><td>1.2.1</td></tr><tr><td><a href="https://github.com/JetBrains/compose-multiplatform/releases/tag/v1.6.1" target="_blank" rel="noreferrer">1.6.1</a></td><td>1.6.3</td><td>1.2.1</td></tr><tr><td><a href="https://github.com/JetBrains/compose-multiplatform/releases/tag/v1.6.0" target="_blank" rel="noreferrer">1.6.0</a></td><td>1.6.1</td><td>1.2.0</td></tr><tr><td><a href="https://github.com/JetBrains/compose-multiplatform/releases/tag/v1.5.12" target="_blank" rel="noreferrer">1.5.12</a></td><td>1.5.4</td><td>1.1.2</td></tr><tr><td><a href="https://github.com/JetBrains/compose-multiplatform/releases/tag/v1.5.11" target="_blank" rel="noreferrer">1.5.11</a></td><td>1.5.4</td><td>1.1.2</td></tr><tr><td><a href="https://github.com/JetBrains/compose-multiplatform/releases/tag/v1.5.10" target="_blank" rel="noreferrer">1.5.10</a></td><td>1.5.4</td><td>1.1.2</td></tr><tr><td><a href="https://github.com/JetBrains/compose-multiplatform/releases/tag/v1.5.1" target="_blank" rel="noreferrer">1.5.1</a></td><td>1.5.0</td><td>1.1.1</td></tr><tr><td><a href="https://github.com/JetBrains/compose-multiplatform/releases/tag/v1.5.0" target="_blank" rel="noreferrer">1.5.0</a></td><td>1.5.0</td><td>1.1.1</td></tr><tr><td><a href="https://github.com/JetBrains/compose-multiplatform/releases/tag/v1.4.3" target="_blank" rel="noreferrer">1.4.3</a></td><td>1.4.3</td><td>1.0.1</td></tr><tr><td><a href="https://github.com/JetBrains/compose-multiplatform/releases/tag/v1.4.1" target="_blank" rel="noreferrer">1.4.1</a></td><td>1.4.3</td><td>1.0.1</td></tr><tr><td><a href="https://github.com/JetBrains/compose-multiplatform/releases/tag/v1.4.0" target="_blank" rel="noreferrer">1.4.0</a></td><td>1.4.0</td><td>1.0.1</td></tr><tr><td><a href="https://github.com/JetBrains/compose-multiplatform/releases/tag/v1.3.1" target="_blank" rel="noreferrer">1.3.1</a></td><td>1.3.3</td><td>1.0.1</td></tr><tr><td><a href="https://github.com/JetBrains/compose-multiplatform/releases/tag/v1.3.0" target="_blank" rel="noreferrer">1.3.0</a></td><td>1.3.3</td><td>1.0.1</td></tr><tr><td><a href="https://github.com/JetBrains/compose-multiplatform/releases/tag/v1.2.1" target="_blank" rel="noreferrer">1.2.1</a></td><td>1.2.1</td><td>1.0.0-alpha14</td></tr><tr><td><a href="https://github.com/JetBrains/compose-multiplatform/releases/tag/v1.2.0" target="_blank" rel="noreferrer">1.2.0</a></td><td>1.2.1</td><td>1.0.0-alpha14</td></tr><tr><td><a href="https://github.com/JetBrains/compose-multiplatform/releases/tag/v1.1.1" target="_blank" rel="noreferrer">1.1.1</a></td><td>1.1.0</td><td>1.0.0-alpha05</td></tr><tr><td><a href="https://github.com/JetBrains/compose-multiplatform/releases/tag/v1.1.0" target="_blank" rel="noreferrer">1.1.0</a></td><td>1.1.0</td><td>1.0.0-alpha05</td></tr><tr><td><a href="https://github.com/JetBrains/compose-multiplatform/releases/tag/v1.0.1" target="_blank" rel="noreferrer">1.0.1</a></td><td>1.1.0-beta02</td><td>1.0.0-alpha03</td></tr><tr><td><a href="https://github.com/JetBrains/compose-multiplatform/releases/tag/v1.0.0" target="_blank" rel="noreferrer">1.0.0</a></td><td>1.1.0-beta02</td><td>1.0.0-alpha03</td></tr></tbody></table>',26)]))}const f=e(l,[["render",s]]);export{h as __pageData,f as default};
